{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/judechimezuruonyenwe/bellabeat-with-r?scriptVersionId=195673831\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"776f93f2","metadata":{"papermill":{"duration":0.015018,"end_time":"2024-09-07T07:57:32.325672","exception":false,"start_time":"2024-09-07T07:57:32.310654","status":"completed"},"tags":[]},"source":["# **Introduction**\n","\n","This is a Capstone Project for the Google Data Analytics Professional certificate.\n","\n","## **Scenario**\n","\n","I am a junior data analyst working in the marketing analytics team at Bellabeat, a high-tech manufacturer of health-focused products for women. They are a small successful company with the potential to become a large player in the global smart device market. I have been tasked to focus on one of Bellabeat’s products; Bellabeat app and analyze smart device fitness data to gain insights into how customers use their smart devices. The insights gained from my analysis will help guide Bellabeat’s marketing strategy. I will present my findings and recommendations to Bellabeat executive team. \n","\n","## **Stakeholders**\n","\n","1. **Urška Sršen**: Bellabeat's co-founder and Chief Creative Officer\n","\n","2. **Sando Mur**: Mathematician and Bellabeat's co-founder; key member of Bellabeat executive team.\n","\n","3. **BellaBeat's Marketing Analytics Team**: A team of data analysts responsible for collecting, analyzing, and reporting data that helps guide Bellabeat’s marketing strategy. I joined this team six months ago and have been busy learning about Bellabeat’s mission and business goals — as well as how I, as a junior data analyst, can help Bellabeat achieve them.\n","\n","## **Products**\n","\n","*  **Bellabeat app**: The Bellabeat app provides users with health data related to their activity, sleep, stress, menstrual cycle, and mindfulness habits. This data can help users better understand their current habits and make healthy decisions. The Bellabeat app connects to their line of smart wellness products.\n","\n","*  **Leaf**: Bellabeat’s classic wellness tracker can be worn as a bracelet, necklace, or clip. The Leaf tracker connects to the Bellabeat app to track activity, sleep, and stress.\n","\n","*  **Time**: This wellness watch combines the timeless look of a classic timepiece with smart technology to track user activity, sleep, and stress. The Time watch connects to the Bellabeat app to provide you with insights into your daily wellness.\n","\n","*  **Spring**: This is a water bottle that tracks daily water intake using smart technology to ensure that you are appropriately hydrated throughout the day. The Spring bottle connects to the Bellabeat app to track your hydration levels.\n","\n","## **About the Company**\n","\n","Bellabeat, a high-tech manufacturer of health-focused products for women. Although, a successful small company, they have the potential to become a larger player in the global smart device market.\n","Urška Sršen and Sando Mur founded Bellabeat. Sršen used her background as an artist to develop beautifully designed technology that informs and inspires women around the world. Since it was founded in 2013, Bellabeat has grown rapidly and quickly positioned itself as a tech-driven wellness company for women.\n","\n","# **Ask**\n","\n","# **Questions to guide our analysis**\n","\n","To achieve the business task, I have to answer the following;\n","1. What are some trends in smart device usage?\n","2. How could these trends apply to Bellabeat customers?\n","3. How could these trends help influence Bellabeat marketing strategy?\n","\n","## **Business Task**\n","\n","Identify trends in how consumers use non-Bellabeat smart devices to apply insights into Bellabeat’s marketing strategy.\n","\n","# **Prepare**\n","\n","### **Data Source** \n","The data source used for our case study is FitBit Fitness Tracker Data. This dataset was generated by respondents to a distributed survey via Amazon Mechanical Turk between 03/12/2016 and 05/12/2016. It is stored in Kaggle and was made available through [Möbius](https://www.kaggle.com/datasets/arashnic/fitbit). It is an open data so it is accessible to the public.\n","\n","### **Data Organization**\n","There are 18 CSV documents made available for the analysis. Each document represents different quantitative data tracked by Fitbit. The data is considered long since each row is one time point per subject, so each subject will have data in multiple rows.Every user has a unique ID and different rows since data is tracked by day and time.\n","\n","### **Data Integrity and Credibility**\n","I evaluated the data using the **ROCCC (Reliable, Original, Comprehensive, Current & Cited)** data test model and found out that;\n","1. It is not **Reliable** since it shows data from only 30 women. It does not show demographics or geographical data for these women and has a very small sample size. This could potentially lead to a sampling bias.\n","2. It is not **Original**: The provenance section shows that the data has been preprocessed.\n","3. It is **Comprehensive**: The metrics in the dataset matches the needs of BellaBeat.\n","4. It is not **Current**: The dataset was last updated 4 years ago.\n","5. It is not **Cited**: This is a third party data and the author's name is blank.\n","\n","# **Process**\n","\n","In order to process the data with easy accessibility, and create visualizations that convey my results and recommendations to the stakeholders, I made use of R.\n","The first step was to install & load the packages required for this process, which in this case were: **tidyverse**, **janitor**, **lubridate** & **skimr**.\n","\n","Loading the packages:"]},{"cell_type":"code","execution_count":1,"id":"a7f49324","metadata":{"_cell_guid":"b1076dfc-b9ad-4769-8c92-a6c4dae69d19"